import React, {useState} from "react";
import {Button, FlatList, Image, StyleSheet, Text, TouchableOpacity, View} from 'react-native';
import {globalStyle} from "../styles/style";
import {Row, Rows, Table} from "react-native-table-component";
import {DataTable} from 'react-native-paper';


export default function History({navigation}) {
    const [news, setNews] = useState([
        {date:'20.01.2022', symptoms: 'one, one, one',
            note: 'wow', key:'1'},
        {date:'01.02.2021', symptoms: 'two, two, two',
            note: 'wow', key:'2'},
        {date:'09.03.2022', symptoms: 'three, three, three',
            note: 'wow', key:'3'},
    ]);


    return (
        <View style={globalStyle.main}>
            <FlatList data={news} renderItem={({item})=> (
                <View>
                    <Text style={styles.title}>{item.date}</Text>
                    <Text style={styles.anons}>{item.symptoms}</Text>
                    <Text style={styles.anons}>{item.note}</Text>
                    <Button title={'look'} onPress={()=> navigation.navigate('FullInfo', item)} />
                </View>
            )} />
        </View>
    );
}

const styles = StyleSheet.create({
    full: {
        fontFamily: 'mt-light',
        fontSize: 16,
        marginTop: 5,
        color: '#474747'
    },
    header: {
        fontSize: 25,
        marginTop: 25
    },
    image: {
        width: '100%',
        height: 200,
    },

});
